'use strict';

/**
* Allium oreophilum (pink lily leek) as a `buffer` object.
*
* @module @stdlib/datasets/img-allium-oreophilum
*
* @example
* var image = require( '@stdlib/datasets/img-allium-oreophilum' );
*
* var img = image();
* // returns <Buffer>
*/

// MODULES //

var IS_BROWSER = require( '@stdlib/assert/is-browser' );


// MAIN //

var image;
if ( IS_BROWSER ) {
	image = require( './browser.js' );
} else {
	image = require( './allium_oreophilum.js' );
}


// EXPORTS //

module.exports = image;
